import React from "react";
import fetch from "./Fetches";

class App extends React.Component {
  componentDidMount() {
    this.fetchData();
  }
  fetchData = async () => {
    let a = await fetch();
    a.forEach(async doc => {
      await <div>(`${doc.id} => ${doc.data().Name}`)</div>;
    });
  };
  render() {
    return <div>HI</div>;
  }
}

export default App;
